def compress(s):

	res = s[0]
	for i in range(1, len(s)):
		if not res:
			res += s[i]
			continue
		if res[-1]!= s[i] and (res[-1]==s[i].lower() or res[-1]==s[i].upper()):
			res = res[:-1]
		else:
			res += s[i]
	return res

def compressc(s, ch):

	s = s.replace(ch, '')
	s = s.replace(ch.upper(), '')
	return s


